// Data Cleaning Function
const items = $input.all();
const cleanedItems = [];

for (const item of items) {
  const data = item.json;
  const cleaned = {};

  // Clean email
  if (data.email) {
    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    cleaned.email = emailRegex.test(data.email.toLowerCase().trim()) ? 
      data.email.toLowerCase().trim() : null;
  }

  // Clean and format phone number
  if (data.phone) {
    const phoneClean = data.phone.replace(/\D/g, '');
    if (phoneClean.length === 10) {
      cleaned.phone = `(${phoneClean.slice(0,3)}) ${phoneClean.slice(3,6)}-${phoneClean.slice(6)}`;
    } else if (phoneClean.length === 11 && phoneClean[0] === '1') {
      cleaned.phone = `(${phoneClean.slice(1,4)}) ${phoneClean.slice(4,7)}-${phoneClean.slice(7)}`;
    } else {
      cleaned.phone = data.phone; // Keep original if can't format
    }
  }

  // Clean and standardize name
  if (data.first_name) {
    cleaned.first_name = data.first_name.trim()
      .toLowerCase()
      .replace(/\b\w/g, l => l.toUpperCase());
  }

  if (data.last_name) {
    cleaned.last_name = data.last_name.trim()
      .toLowerCase()
      .replace(/\b\w/g, l => l.toUpperCase());
  }

  // Clean address components
  if (data.address) {
    cleaned.address = data.address.trim()
      .toLowerCase()
      .replace(/\b\w/g, l => l.toUpperCase())
      .replace(/\bSt\b/g, 'Street')
      .replace(/\bAve\b/g, 'Avenue')
      .replace(/\bRd\b/g, 'Road')
      .replace(/\bDr\b/g, 'Drive');
  }

  if (data.city) {
    cleaned.city = data.city.trim()
      .toLowerCase()
      .replace(/\b\w/g, l => l.toUpperCase());
  }

  if (data.state) {
    cleaned.state = data.state.trim().toUpperCase();
  }

  if (data.zip) {
    const zipClean = data.zip.replace(/\D/g, '');
    cleaned.zip = zipClean.length >= 5 ? zipClean.slice(0, 5) : data.zip;
  }

  // Calculate completeness score
  const requiredFields = ['email', 'phone', 'first_name', 'last_name', 'address', 'city', 'state', 'zip'];
  const completedFields = requiredFields.filter(field => cleaned[field] && cleaned[field] !== null);
  cleaned.completeness_score = Math.round((completedFields.length / requiredFields.length) * 100);

  // Copy other fields
  Object.keys(data).forEach(key => {
    if (!cleaned.hasOwnProperty(key)) {
      cleaned[key] = data[key];
    }
  });

  // Add processing metadata
  cleaned.processed_date = new Date().toISOString();
  cleaned.data_source = 'nys_motor_vehicle';

  cleanedItems.push({ json: cleaned });
}

return cleanedItems;

// Additional Business Logic Filtering
const items = $input.all();
const filteredItems = [];

for (const item of items) {
  const data = item.json;
  let includeRecord = true;

  // Vehicle type filtering (if vehicle data exists)
  if (data.vehicle_year) {
    const currentYear = new Date().getFullYear();
    const vehicleYear = parseInt(data.vehicle_year);

    // Filter vehicles older than 20 years
    if (currentYear - vehicleYear > 20) {
      includeRecord = false;
    }
  }

  // Registration date filtering (if exists)
  if (data.registration_date) {
    const regDate = new Date(data.registration_date);
    const twoYearsAgo = new Date();
    twoYearsAgo.setFullYear(twoYearsAgo.getFullYear() - 2);

    // Filter registrations older than 2 years
    if (regDate < twoYearsAgo) {
      includeRecord = false;
    }
  }

  // Quality score enhancement
  let qualityScore = data.completeness_score || 0;

  // Bonus points for complete contact info
  if (data.email && data.phone) qualityScore += 10;
  if (data.address && data.city && data.state && data.zip) qualityScore += 10;

  // Penalty for suspicious data patterns
  if (data.phone && data.phone.includes('000-000-0000')) qualityScore -= 20;
  if (data.email && data.email.includes('noemail')) qualityScore -= 15;

  data.final_quality_score = Math.min(100, Math.max(0, qualityScore));

  // Final quality threshold
  if (data.final_quality_score < 60) {
    includeRecord = false;
  }

  if (includeRecord) {
    // Add lead source and segmentation
    data.lead_source = 'NYS Motor Vehicle Records';
    data.lead_segment = data.final_quality_score >= 85 ? 'High Quality' : 
                       data.final_quality_score >= 70 ? 'Medium Quality' : 'Low Quality';

    filteredItems.push({ json: data });
  }
}

return filteredItems;

// Generate Processing Report
const allItems = $input.all();
const summary = {
  processing_date: new Date().toISOString(),
  workflow_name: 'Data Cleansing Workflow',
  source_file: $('Google Drive Trigger').first().json.name,

  // Processing statistics
  total_records_processed: $('Parse CSV Data').all().length,
  records_after_cleaning: $('Data Cleaning Process').all().length,
  records_after_filtering: $('Apply Business Logic').all().length,
  records_uploaded_to_hubspot: allItems.length,

  // Quality metrics
  success_rate: Math.round((allItems.length / $('Parse CSV Data').all().length) * 100),
  average_quality_score: Math.round(
    allItems.reduce((sum, item) => sum + (item.json.final_quality_score || 0), 0) / allItems.length
  ),

  // Segmentation breakdown
  high_quality_leads: allItems.filter(item => item.json.lead_segment === 'High Quality').length,
  medium_quality_leads: allItems.filter(item => item.json.lead_segment === 'Medium Quality').length,
  low_quality_leads: allItems.filter(item => item.json.lead_segment === 'Low Quality').length,

  // Geographic distribution
  states_represented: [...new Set(allItems.map(item => item.json.state))],

  // Data quality insights
  records_with_email: allItems.filter(item => item.json.email).length,
  records_with_phone: allItems.filter(item => item.json.phone).length,
  records_with_complete_address: allItems.filter(item => 
    item.json.address && item.json.city && item.json.state && item.json.zip
  ).length,

  // Processing efficiency
  processing_start_time: $('Google Drive Trigger').first().json.lastModifiedTime,
  processing_end_time: new Date().toISOString(),

  // Recommendations
  recommendations: [
    allItems.length < 100 ? 'Consider reviewing data source quality' : null,
    summary.average_quality_score < 70 ? 'Review filtering criteria to improve lead quality' : null,
    summary.success_rate < 50 ? 'Check data cleaning algorithms for effectiveness' : null
  ].filter(Boolean)
};

// Calculate processing duration
const startTime = new Date(summary.processing_start_time);
const endTime = new Date(summary.processing_end_time);
summary.processing_duration_minutes = Math.round((endTime - startTime) / (1000 * 60));

return [{ json: summary }];
